        research provides limited insights into when political communications prime
        or change citizens\u2019 underlying opinions.  This paper helps fill that
        void by putting forth an account of priming and opinion change.  I argue that
        crystallized attitudes should often be primed by new information.  An influx
        of attention to less crystalized preferences, however, should lead individuals
        to alter their underlying opinions in accordance with prior beliefs.  Since
        predispositions acquired early in the lifecycle like partisanship, religiosity,
        basic values, and group-based affect/antagonisms are more crystallized than
        mass opinion about public policy, media and campaign content will tend to
        prime citizens\u2019 predispositions and change their policy positions.  Both
        my review of previous priming research and original analyses presented in
        this study from five new cases strongly support that crystallization-based
        account of when mass opinion is primed or changed.  I conclude with a discussion
        of the paper\u2019s potential political, methodological, and normative implications.\"},\"dsDescriptionDate\":{\"typeName\":\"dsDescriptionDate\",\"multiple\":false,\"typeClass\":\"primitive\",\"value\":\"2015\"}}]},{\"typeName\":\"subject\",\"multiple\":true,\"typeClass\":\"controlledVocabulary\",\"value\":[\"Social
